//Import Components
import Navbar from '../Navbar/Navbar';
import Header from '../Header/Header';
import About from '../About/About';
import Projects from '../Projects/Projects';



const App = () => {
  return (
    <div className="App">
      <Navbar/>
      <Header/>
      <About/>
      <Projects/>
    </div>
  );
}

export default App;
